import Link from 'next/link';

export const config = { amp: true }

export default function Test() {
  return (
    <div>
      <Link href="/test/siemanko" shallow={true}>
        <a>Siemanko</a>
      </Link>
      <p>This is the test view!</p>
    </div>
  );
}
